import React from 'react'
import { KTSVG, toAbsoluteUrl } from '_metronic/helpers'
import { ComputerModel } from 'app/modules/history/models/Account'
import {resetComputer} from 'app/modules/history/redux/AccountCRUD'
import moment from 'moment'
type Props = {
    item: ComputerModel,
    index: number
}

const ComputerItem: React.FC<Props> = ({ item, index }) => {

    const clickDeleteHandler= async()=>{
        if (window.confirm("bạn có chắc chắn muốn reset luồng trên VPS này") == true) {
            const res:any = await resetComputer(item.vps)
            //dispatch(actions.deleteOrderRequest(item.channel_id))
        }
    }

    return (
        <tr>
            <td>
                <div className='d-flex flex-stack mb-2'>
                    <span className='text-muted me-2 fs-7 fw-bold'>{index + 1}</span>
                </div>
            </td>
            <td>
                <a href='#' className='text-sm text-dark fw-bolder text-hover-primary d-block mb-1 '>
                    {item.vps}
                </a>
            </td>
            <td>
                <span className='text-muted fw-bold text-muted d-block text-sm'>{item.total}</span>
            </td>
            <td>
                <span className='text-muted fw-bold text-muted d-block text-sm'>{item.time=='0'?"Vừa xong":item.time+ " phút trước"}</span>
            </td>
            <td>

                    <a href='#' onClick={clickDeleteHandler} className='btn btn-icon btn-bg-secondary btn-active-color-primary btn-sm'>
                    <KTSVG path='/media/icons/duotune/general/gen027.svg' className='svg-icon-danger' />
                    </a>

            </td>
        </tr>
    )
}

export default ComputerItem
